import React from 'react';
import './style.css';

export default function LenderItem(item) {
  console.log(item.item);
  console.log(item.amountLend);
  return (
    <div className="lenderItemLine">
      <div className="lenderItemLineWrapper">
        <div className="lenderItemLineLeft">
          <div className="lenderItemLineIcon icon"></div>

          <div className="lenderItemLineName">Name</div>

          <div className="lenderItemLineUsername">username</div>
        </div>

        <div className="lenderItemLineRight">
          <div className="lenderItemLinePercent">(5%)</div>

          <div className="lenderItemLineValue"></div>
        </div>
      </div>
    </div>
  );
}
